import React, {} from 'react';
import styled from 'styled-components';
import {Container} from '../style/styled';


const CustomModal = () =>{
    return(

        <>
            <Container>
                <h2>Modal</h2>

                <ModalContainer>

                </ModalContainer>
            </Container>
        </>
    )
}

const ModalContainer = styled.div`
    dispaly: block;
    width: 80px;
    height: 40px;
    line-height: 30px;
    text-align: center;
    border-radius: 30px;
    background-color: black;
    margin: 0 auto;
    
`

export default CustomModal;
